customMethods.script:
# Opens the vav details side panel when pressing on a zone in the floorplan. Passes the
# path to the vav, the area/dept, a boolean signifying whether this is a dept vs area,
# and a boolean signifying whether we are in a mobile environment.

if 'HC' in vav:
	system.perspective.openDock('vavDetailsHC',params={'vav':'BMS/90BR/VAV/' + vav,'area':area,'isDept':isDept,'isMobile':self.view.params.isMobile})
elif 'CO2' in vav:
	system.perspective.openDock('vavDetailsCO2',params={'vav':'BMS/90BR/VAV/' + vav,'area':area,'isDept':isDept,'isMobile':self.view.params.isMobile})
elif 'ERH' in vav:
	system.perspective.openDock('vavDetailsERH',params={'vav':'BMS/90BR/VAV/' + vav,'area':area,'isDept':isDept,'isMobile':self.view.params.isMobile})
else:
	system.perspective.openDock('vavDetails',params={'vav':'BMS/90BR/VAV/' + vav,'area':area,'isDept':isDept,'isMobile':self.view.params.isMobile})
